import React from 'react';

const AddAssetsButton = () => {
  return (
    <button
      className="flex w-[130px] h-[41px] p-4 justify-center items-center gap-4 flex-shrink-0 rounded-lg bg-[#68C231] text-[#343B3F] font-roboto text-[20px] font-semibold"
    >
      Add Asset
    </button>
  );
};

export default AddAssetsButton;
